// ═══════════════════════════════════════════════════════
    //  THREE.JS ENGINE — handles both idle BG + transition
    // ═══════════════════════════════════════════════════════
    const SceneEngine = (function () {
        const CREST_B64 = 'data:image/png;base64,';

        const canvas = document.getElementById('bg-canvas');
        const renderer = new THREE.WebGLRenderer({ canvas, antialias: true });
        renderer.setPixelRatio(Math.min(window.devicePixelRatio, 2));
        renderer.setSize(window.innerWidth, window.innerHeight);
        renderer.toneMapping = THREE.ACESFilmicToneMapping;
        renderer.toneMappingExposure = 1.05;

        const scene  = new THREE.Scene();
        scene.background = new THREE.Color(0x050c1c);
        const camera = new THREE.PerspectiveCamera(55, window.innerWidth / window.innerHeight, 0.1, 200);
        camera.position.set(0, 0, 24);

        // Lights
        scene.add(new THREE.AmbientLight(0x1a3060, 2.0));
        const keyL  = new THREE.DirectionalLight(0xffffff, 1.5); keyL.position.set(6,8,14); scene.add(keyL);
        const goldL = new THREE.PointLight(0xf5c842, 5, 40); goldL.position.set(2,2,12); scene.add(goldL);
        const blueL = new THREE.PointLight(0x2255cc, 3, 35); blueL.position.set(-10,4,-2); scene.add(blueL);
        const rimL  = new THREE.PointLight(0xffffff, 1.5, 22); rimL.position.set(8,-6,10); scene.add(rimL);

        // Bg shader
        const bgMat = new THREE.ShaderMaterial({
            uniforms: { time:{value:0} },
            vertexShader:   `varying vec2 vUv;void main(){vUv=uv;gl_Position=projectionMatrix*modelViewMatrix*vec4(position,1.0);}`,
            fragmentShader: `uniform float time;varying vec2 vUv;void main(){vec2 c=vUv-0.5;float d=length(c);vec3 dark=vec3(0.018,0.045,0.10),mid=vec3(0.04,0.10,0.24),gold=vec3(0.38,0.22,0.02);float p=0.5+0.5*sin(time*0.55);vec3 col=mix(mid,dark,smoothstep(0.0,0.65,d*1.8));col+=gold*p*smoothstep(0.35,0.0,d)*0.28;gl_FragColor=vec4(col,1.0);}`,
            depthWrite: false,
        });
        const bgPlane = new THREE.Mesh(new THREE.PlaneGeometry(120,80), bgMat);
        bgPlane.position.z = -35; scene.add(bgPlane);

        // Crest mesh builder
        function makeCrestMesh(tex, radius, opacity) {
            const g = new THREE.Group();
            const disc = new THREE.Mesh(
                new THREE.CylinderGeometry(radius,radius,0.28,128),
                new THREE.MeshStandardMaterial({color:0x0d1e40,roughness:0.25,metalness:0.75,transparent:true,opacity})
            );
            disc.rotation.x = Math.PI/2; g.add(disc);
            const fGeo = new THREE.CircleGeometry(radius,128);
            const face = new THREE.Mesh(fGeo, new THREE.MeshStandardMaterial({map:tex,transparent:true,opacity,roughness:0.18,metalness:0.3,alphaTest:0.05}));
            face.position.z = 0.15; g.add(face);
            const back = new THREE.Mesh(fGeo.clone(), new THREE.MeshStandardMaterial({map:tex,transparent:true,opacity:opacity*0.6,roughness:0.3,metalness:0.2,side:THREE.BackSide,alphaTest:0.05}));
            back.position.z = -0.15; g.add(back);
            const rim = new THREE.Mesh(new THREE.TorusGeometry(radius+0.04,0.10,12,128), new THREE.MeshStandardMaterial({color:0xd4a820,roughness:0.15,metalness:0.95,transparent:true,opacity}));
            g.add(rim);
            return g;
        }

        function makeRing(radius,tube,color,opacity,z) {
            const m = new THREE.Mesh(new THREE.TorusGeometry(radius,tube,8,128), new THREE.MeshBasicMaterial({color,transparent:true,opacity}));
            m.position.z = z; return m;
        }

        // State
        let mainCrest = null;
        const miniCrests = [], rings = [];

        // Transition state
        const TR = {
            active:    false,   // are we transitioning?
            phase:     'idle',  // 'spin-in' | 'hold' | 'spin-out' | 'idle'
            progress:  0,       // 0..1
            speed:     0,
            // saved idle state
            idleRotY:  0, idleRotX: 0, idleScale: 1,
        };

        // Load texture
        const img = new Image();
        img.onload = function () {
            const tex = new THREE.Texture(img);
            tex.needsUpdate = true;
            tex.anisotropy = renderer.capabilities.getMaxAnisotropy();

            mainCrest = makeCrestMesh(tex, 8.0, 0.40);
            scene.add(mainCrest);

            const r1=makeRing(9.2,0.075,0xf5c842,0.50,-0.4);
            const r2=makeRing(10.1,0.050,0x2255cc,0.28,-0.9);
            const r3=makeRing(11.8,0.032,0xffffff,0.14,-1.4);
            const r4=makeRing(14.0,0.025,0xf5c842,0.10,-2.0);
            scene.add(r1,r2,r3,r4);
            rings.push({mesh:r1,speed:0.07},{mesh:r2,speed:-0.045},{mesh:r3,speed:0.028},{mesh:r4,speed:-0.016});

            [{x:-19,y:7,z:-12,s:.30,op:.20},{x:17,y:9,z:-14,s:.24,op:.16},
             {x:-15,y:-8,z:-16,s:.28,op:.14},{x:20,y:-6,z:-11,s:.26,op:.18},
             {x:-9,y:12,z:-20,s:.18,op:.11},{x:12,y:-11,z:-18,s:.22,op:.13},
             {x:-22,y:2,z:-22,s:.16,op:.09},{x:24,y:3,z:-19,s:.19,op:.11}
            ].forEach(d => {
                const m = makeCrestMesh(tex, 8.0*d.s, d.op);
                m.position.set(d.x, d.y, d.z);
                m.userData = {baseY:d.y, floatSpeed:.28+Math.random()*.38, floatAmp:.35+Math.random()*.55, phase:Math.random()*Math.PI*2, rotSpeed:(Math.random()-.5)*.005, tiltBase:(Math.random()-.5)*.25};
                scene.add(m); miniCrests.push(m);
            });
        };
        img.src = CREST_B64;

        // Particles
        const pCount=500, pPos=new Float32Array(pCount*3), pCol=new Float32Array(pCount*3);
        for(let i=0;i<pCount;i++){
            pPos[i*3]=(Math.random()-.5)*90; pPos[i*3+1]=(Math.random()-.5)*60; pPos[i*3+2]=-10-Math.random()*30;
            if(i%3===0){pCol[i*3]=.96;pCol[i*3+1]=.78;pCol[i*3+2]=.26;}
            else{pCol[i*3]=.30;pCol[i*3+1]=.55;pCol[i*3+2]=1.0;}
        }
        const pGeo = new THREE.BufferGeometry();
        pGeo.setAttribute('position', new THREE.BufferAttribute(pPos,3));
        pGeo.setAttribute('color',    new THREE.BufferAttribute(pCol,3));
        const pMat = new THREE.PointsMaterial({size:.13,vertexColors:true,transparent:true,opacity:.65});
        scene.add(new THREE.Points(pGeo,pMat));

        window.addEventListener('resize', () => {
            camera.aspect = window.innerWidth/window.innerHeight;
            camera.updateProjectionMatrix();
            renderer.setSize(window.innerWidth, window.innerHeight);
        });

        // ── TRANSITION TARGETS ──
        // During transition the main crest:
        //   - moves to z=0 (already there), scale ramps up to ~1.6
        //   - spins fast on Y axis (multiple full rotations)
        //   - then scale back down to normal

        let t = 0;
        let trTime = 0;           // transition local time
        let trBaseRotY = 0;       // rotation Y at start of transition
        let trOnSwap = null;      // callback to call at peak
        let trSwapCalled = false;

        const TR_DURATION   = 1.6;  // seconds total
        const TR_PEAK       = 0.45; // fraction where page swaps (scale peak)
        const TR_SPIN_SPEED = 14;   // radians per second during spin

        function easeInOut(x){ return x<0.5 ? 2*x*x : 1-Math.pow(-2*x+2,2)/2; }
        function easeOut(x)  { return 1-Math.pow(1-x,3); }

        (function animate(){
            requestAnimationFrame(animate);
            const dt = 0.016; // ~60fps fixed step (good enough)
            t += 0.007;
            bgMat.uniforms.time.value = t;

            if (!mainCrest) { renderer.render(scene,camera); return; }

            if (TR.active) {
                trTime += dt;
                const prog = Math.min(trTime / TR_DURATION, 1.0);

                // Scale: ramp up to 1.6 at peak, back to 1 by end
                let sc;
                if (prog < TR_PEAK) {
                    sc = 1.0 + easeInOut(prog / TR_PEAK) * 0.65;
                } else {
                    sc = 1.65 - easeOut((prog - TR_PEAK) / (1.0 - TR_PEAK)) * 0.65;
                }
                mainCrest.scale.set(sc, sc, sc);

                // Fast spin on Y
                trBaseRotY += TR_SPIN_SPEED * dt;
                mainCrest.rotation.y = trBaseRotY;
                mainCrest.rotation.x = 0;

                // Rings spin faster during transition
                rings.forEach(r => { r.mesh.rotation.z += r.speed * 0.06; });

                // Gold light pulses brighter
                goldL.intensity = 6.0 + Math.sin(t*4)*2.0;
                blueL.intensity = 4.0 + Math.sin(t*3+1)*1.0;

                // Trigger page swap at peak
                if (!trSwapCalled && prog >= TR_PEAK) {
                    trSwapCalled = true;
                    if (trOnSwap) trOnSwap();
                }

                // Done
                if (prog >= 1.0) {
                    TR.active = false;
                    trTime = 0;
                    trSwapCalled = false;
                    mainCrest.scale.set(1,1,1);
                }

            } else {
                // ── IDLE ANIMATION ──
                const b = 1.0 + Math.sin(t*.65)*.022;
                mainCrest.scale.set(b,b,1);
                mainCrest.rotation.y = Math.sin(t*.18)*.20;
                mainCrest.rotation.x = Math.sin(t*.14)*.09;
                trBaseRotY = mainCrest.rotation.y; // keep in sync

                rings.forEach(r => { r.mesh.rotation.z += r.speed*.012; });
                goldL.intensity = 4.0+Math.sin(t*.95)*1.4;
                blueL.intensity = 2.5+Math.sin(t*.75+1.5)*.9;
                rimL.intensity  = 1.2+Math.sin(t*1.2+.8)*.45;
            }

            miniCrests.forEach(m => {
                const d = m.userData;
                m.rotation.z += d.rotSpeed;
                m.rotation.y  = d.tiltBase + Math.sin(t*.16)*.14;
                m.position.y  = d.baseY + Math.sin(t*d.floatSpeed+d.phase)*d.floatAmp;
            });

            pMat.opacity = .50+Math.sin(t*.85)*.18;
            renderer.render(scene, camera);
        })();

        // Public API
        return {
            startTransition: function(onSwap) {
                if (TR.active) return;
                TR.active    = true;
                trTime       = 0;
                trSwapCalled = false;
                trOnSwap     = onSwap;
            }
        };
    })();